import React from 'react';

export default class Weather extends React.Component{
      render(){
            return(
                  <div className="weather">
                  {this.props.city && this.props.country && <label>Location:  <span>{this.props.city} {this.props.country}</span></label> }
                        <label>Temperature:  <span>{this.props.temperature}</span></label> 
                        <label>Humidity:  <span>{this.props.humidity}</span></label> 


                        <label>Description:  <span>{this.props.description}</span></label>
                  </div>
            )
      }
}
